import React from 'react';
import drinks from './drinks.jpg'
import './Body.css'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';



function Adminlist (props)  {

    return (   
                
                <div className="item col-md-3 col-sm-"  style={{border:'solid', marginRight:'1.5%', marginLeft:'1.5%', marginTop:'2%', borderRadius:'5%', backgroundColor:'#F1EFEF'}}>
                    <p><b>{props._id}</b></p>
                    <p><b>{props.username}</b></p>
                    <p><b>{props.name}</b></p>
                    <p><b>{props.address}</b></p>
                    <p><b>{props.phone}</b></p>
                    <p><b>{props.email}</b></p>
                </div>  

    )   
    
    }

export default Adminlist;
